import React, { Component } from 'react';
import { Pagination } from 'semantic-ui-react'



class Fouet extends Component {
    render() {
        return (
            <div>
                <Pagination defaultActivePage={1} totalPages={19} />
            </div>
        );
    }
}

export default Fouet;
